import React, { useState } from "react";
import Header from "../../components/Header";
import Waves from "../../components/Waves";
import Info from "../../components/Info";
// import Register from "./Register";
// import Brains from "./Brains";
import Card from "../../components/Card";
import About from "../../components/About";
// import Snow from "./Snow";
// import Carousel from "./Carousel"
import Team from "../../components/Team";
import Graph from "../../components/Graph";

// CSS for styling
import './landing.css';

function MatadorLanding() {


  // State variables for dynamically modifying the pages content
  const [apiTest, setApiTest] = useState(null);
  const [isLoading, setIsLoading] = useState(true);

  // Code that puts calls our server's api when the button is pressed.
  const testApi = () => {
    fetch('/api/test')
      .then(response => response.json()) // Converts the response to json
      .then(x => setApiTest(x.a)) // Extracts the attribute "a" from the json object and sets that to the api test variable.
      .then(setIsLoading(false)); // Set loading to false
  };

  return (
    // Return the appropriate HTML code
    <div className="landing">

    <div className = "landing__body">

      <div className="landing__body__left">

          <Info />


      </div>

      <div className="landing__body__right">

        <Card />

      </div>

    </div>

    <div className="landing__body__2">

      <About />

    </div>

    <div className="landing__body__4">

      <Team />

    </div>
    </div>
  );
}

export default MatadorLanding;
